import React from 'react';
import redGif from './path/to/red-gif.gif';
import './RedGif.css';

const RedGif = () => {
  return (
    <div className="red-gif-container">
      <img src={redGif} alt="Red GIF" className="red-gif" />
    </div>
  );
};

export default RedGif;
